import ExitToApp from "@material-ui/icons/ExitToApp"
import NewCases from "views/NewCases/NewCases.js";

const casesRoutes = [
    {
      path: "/newcases",
      name: "New Cases",
      icon: ExitToApp,
      component: NewCases,
      layout: "/cases"
    }
  ];
  
  export default casesRoutes;
